const buttonGrid = document.getElementById('buttonGrid');
const buttonLength = 30;
let currentButtonIndex = 0;

// Create buttons and add them to the grid container
for (let i = 0; i < buttonLength; i++) {
    const button = document.createElement('button');
    button.textContent = '';

    // Add click event listener to each button
    button.addEventListener('click', () => {
        if (button.textContent != '') {
            const currentColor = button.style.backgroundColor;

            // Cycle through colors: grey -> yellow -> green -> back to grey
            if (currentColor === 'grey' || currentColor === '') {
                button.style.backgroundColor = 'yellow';
            } else if (currentColor === 'yellow') {
                button.style.backgroundColor = 'green';
            } else if (currentColor === 'green') {
                button.style.backgroundColor = 'grey';
            }
        }
    });

    // Append button to the grid container
    buttonGrid.appendChild(button);
}

// Event listener for keyboard input
document.addEventListener('keydown', (event) => {
    const keyPressed = event.key;

    // Check if the pressed key is a letter
    if (keyPressed === 'Enter') {
        solve();
    }
    else if (/^[a-zA-Z]$/.test(keyPressed) && currentButtonIndex < buttonLength) {
        const buttons = buttonGrid.querySelectorAll('button');
        const currentButton = buttons[currentButtonIndex];

        if (currentButton) {
            // Convert letter to uppercase and set it to the current button
            currentButton.textContent = keyPressed.toUpperCase();
            currentButtonIndex = currentButtonIndex + 1; // Move to the next button

        }
    } else if (keyPressed === 'Backspace' && currentButtonIndex > 0) { // Handle Backspace key
        const buttons = buttonGrid.querySelectorAll('button');
        buttons[currentButtonIndex - 1].textContent = ''; // Clear current button text
        buttons[currentButtonIndex - 1].style.backgroundColor = 'grey';


        // Move cursor back to the previous button
        currentButtonIndex = currentButtonIndex - 1;
    }

    // Prevent default behavior for all keys
    if (!/^[a-zA-Z]$/.test(keyPressed) && keyPressed !== 'Backspace') {
        event.preventDefault();
    }
});


function grey(letter) {
    console.log("grey  " + letter);
    for (let i = 0; i < solList.length; i++) {
        if (solList[i].indexOf(letter) !== -1) {
            solList.splice(i, 1);
            i--;
        }
    }
}

function doubleGrey(letter, occs) {
    console.log("doubleGrey " + letter);
    for (let i = 0; i < solList.length; i++) {
        let temp = solList[i];
        let apps = temp.split(letter).length - 1;
        if (apps > occs) {
            solList.splice(i, 1);
            i--;
        }
    }
}

function yellow(letter, pos) {
    console.log("yellow  " + letter + pos);
    for (let i = 0; i < solList.length; i++) {
        if (solList[i][pos] === letter || solList[i].indexOf(letter) == -1) {
            solList.splice(i, 1);
            i--;
        }
    }
}

function doubleYellow(letter, pos, occs) {
    console.log("doubleYellow " + letter + pos);
    for (let i = 0; i < solList.length; i++) {
        let temp = solList[i];
        let apps = temp.split(letter).length - 1;
        if (solList[i][pos] === letter || solList[i].indexOf(letter) == -1 || apps <= occs) {
            solList.splice(i, 1);
            i--;
        }
    }
}

function green(letter, pos) {
    console.log("green  " + letter + pos);
    for (let i = 0; i < solList.length; i++) {
        if (solList[i][pos] !== letter) {
            solList.splice(i, 1);
            i--;
        }
    }
}


function solve() {

    resetList();

    let usedY = '';
    let usedG = '';

    const buttons = buttonGrid.querySelectorAll('button');

    for (let i = 0; i < buttonLength && buttons[i].textContent !== ''; i++) {
        if (buttons[i].style.backgroundColor === 'green') {
            green(buttons[i].textContent, i % 5);
            usedG += buttons[i].textContent;
        }
    }
    for (let i = 0; i < buttonLength && buttons[i].textContent !== ''; i++) {
        if (buttons[i].style.backgroundColor === 'yellow') {
            let tempG = usedG, tempY = usedY;
            let occs = tempG.split(buttons[i].textContent).length + tempY.split(buttons[i].textContent).length - 2;
            if (occs == 0) {
                yellow(buttons[i].textContent, i % 5);
                usedY += buttons[i].textContent;
            }
            else {
                doubleYellow(buttons[i].textContent, i % 5, occs);
                usedY += buttons[i].textContent;
            }
        }
    }
    for (let i = 0; i < buttonLength && buttons[i].textContent !== ''; i++) {
        if (buttons[i].style.backgroundColor === 'grey' || buttons[i].style.backgroundColor === '') {
            let tempG = usedG, tempY = usedY;
            let occs = tempG.split(buttons[i].textContent).length + tempY.split(buttons[i].textContent).length - 2;
            if (occs == 0) {
                grey(buttons[i].textContent);
            }
            else {
                doubleGrey(buttons[i].textContent, occs);
            }
        }
    }

    const valids = document.getElementById('valids');
    const validNum = document.getElementById('validNum');


    const updatedvalids = solList.join(" | ");

    valids.innerHTML = updatedvalids;
    validNum.innerHTML = "Valid Solutions: " + solList.length + " Optimal Guess: " + solList[0];

    const textField = document.getElementById('textInput');
    if (textField) {
        textField.value = "";
    }
}